const ProtectedRouteAdmin = ({ component: Component, ...rest }) => {
    const {
        userState: { user },
    } = useContext(userContext);
    console.log(user);
    return (
        <>
            {user.role === 1 && <NotFound />}
            {user.role === 0 && <Route {...rest} component={Component} />}
        </>
    );
    // if (user.role === 0) return <NotFound />;

